import './App.css';
import React from 'react';
import Header from "./Components/Header/Header.js";
import OptionsBar from "./Components/OptionsBar/OptionsBar.js";
import headshot from './Assets/Headshot.png';

function App() {

  return (
    <div className="App">
      <Header />
      <OptionsBar />
      {OptionsBar.button_clicked == 1 ?
      <div className = "home_text">
        Hi! My name is Grace and I'm a computer science student with a mechanical engineering minor at Boston University. Check out my site to learn more about me and my experiences!
      </div>
      : <div> test </div>}
    </div>

  );
}

export default App;
